import type { TicketData } from './tickets';
import { initDates } from '../+page.svelte';
import fetch from 'node-fetch';

const getTicketNumber = (ticket: TicketData) => {
    return `${ticket.id.toString().padStart(6, '0')}`;
};

const splitArrayIntoEvenChunks = (array: Array<string>, chunkSize: number) => {
    const result: Array<Array<string>> = [];
    for (let i = 0; i < array.length; i += chunkSize) {
        result.push(array.slice(i, i + chunkSize));
    }
    return result;
};

const getLetterIndex = (chunks: Array<Array<string>>, letter: string) => {
    for (let i = 0; i < chunks.length; i++) {
        if (chunks[i].includes(letter)) {
            return i;
        }
    }
    return null;
};

const avatars = [
    'http://localhost:5173/images/avatars/aditya.png',
    'http://localhost:5173/images/avatars/arman.png',
    'http://localhost:5173/images/avatars/jesse.png',
    'http://localhost:5173/images/avatars/chen.png',
    'http://localhost:5173/images/avatars/damodar.png'
];

const alphabet = 'abcdefghijklmnopqrstuvwxyz'.split('');
const chunks = splitArrayIntoEvenChunks(alphabet, 9);

const convertImageToDataUri = async (name: string, avatarUrl?: string) => {
    const firstLetter = name.split('')[0].toLowerCase();
    const avatar = avatars[getLetterIndex(chunks, firstLetter) ?? 0];

    try {
        // Fetch the image
        const response = await fetch(avatarUrl ?? avatar);

        if (!response.ok) {
            throw new Error(`Failed to fetch image: ${response.statusText}`);
        }

        const contentType = response.headers.get('content-type');
        if (!contentType?.startsWith('image/')) {
            throw new Error('The URL did not return an image');
        }

        const arrayBuffer = await response.arrayBuffer();
        const buffer = Buffer.from(arrayBuffer);
        const base64 = buffer.toString('base64');
        const dataUri = `data:${contentType};base64,${base64}`;

        return dataUri;
    } catch (error) {
        throw new Error(`Error converting image to data URI: ${error}`);
    }
};

